import logo from './logo.svg';
import './App.css';
import Header from './header/Header';
import Model from './model/Model';
import data from './TD4.js';
import { useState, useEffect } from 'react';


function App() {

  const [models, setModels] = useState(data);

  const models0 = data.flatMap(brand => {
    brand.models.map(model => {
      model['brand'] = brand.name;
      model.brand = brand.name;
      return model;
    });
    return brand.models;
  });

  models = data.flatMap(brand => {
    return brand.models.map(model =>{
      return {...model, brand: brand.name};
    });
  });

  const modelElements = models.map(model => <Model name={model.name} brand={model.brand} cars={model.cars} key={model.id}/>);

  console.log(models);

  return (
    <section className="app-container">

      <Header />

    <section className="app-content">   

      {modelElements}


    </section>
    <div className="overlay"></div>
  </section>
  );
}

export default App;
